import './File.css'
import { Link } from 'react-router-dom'

export const File = ({ data, onClick }) => {
	return (
		<>{ data.filename }</>
	)
}

export const Dir = ({ data }) => {
	return (
		<Link to={`/Files${data.path}`}>{data.filename}</Link>
	)
}

export const Preview = ({ data }) => {
	return (
		<>File Preview</>
	)
}
